import React, { useEffect, useState } from 'react';
import axios from 'axios';
import SgbdMetricsChart from './SgbdMetricsChart'; // Import the chart component

const SgbdOverview = () => {
  const [performanceMetrics, setPerformanceMetrics] = useState(null);
  const [diskIO, setDiskIO] = useState([]);
  const [networkTraffic, setNetworkTraffic] = useState([]);
  const [innodbMetrics, setInnodbMetrics] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      const credentials = JSON.parse(localStorage.getItem('dbCredentials'));
      if (credentials) {
        const { host, username, password } = credentials;

        try {
          const performanceResponse = await axios.get('http://localhost:5000/api/performance-metrics', {
            params: { host, username, password },
          });
          if (performanceResponse.data.success) {
            setPerformanceMetrics(performanceResponse.data);
          }

          const diskIOResponse = await axios.get('http://localhost:5000/api/disk-io', {
            params: { host, username, password },
          });
          if (diskIOResponse.data.success) {
            setDiskIO(diskIOResponse.data.diskIO);
          }

          const networkTrafficResponse = await axios.get('http://localhost:5000/api/network-traffic', {
            params: { host, username, password },
          });
          if (networkTrafficResponse.data.success) {
            setNetworkTraffic(networkTrafficResponse.data.networkTraffic);
          }

          const innodbMetricsResponse = await axios.get('http://localhost:5000/api/innodb-metrics', {
            params: { host, username, password },
          });
          if (innodbMetricsResponse.data.success) {
            setInnodbMetrics(innodbMetricsResponse.data.innodbMetrics);
          }
        } catch (error) {
          console.error('Error fetching SGBD data:', error);
        } finally {
          setLoading(false);
        }
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <div className="text-center text-white">Loading...</div>;
  }

  return (
    <div className="bg-gray-900 min-h-screen p-8 font-sans">
      <h1 className="text-4xl font-extrabold text-white mb-8 tracking-tight text-center">SGBD Overview</h1>
      {performanceMetrics ? (
        <div className="bg-gradient-to-r from-gray-800 to-gray-900 p-6 rounded-lg shadow-xl transform hover:scale-105 transition-all duration-300">
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            <div className="bg-gray-800 p-4 rounded-lg shadow-md">
              <p className="text-lg text-gray-400"><strong>Threads Connected:</strong> {performanceMetrics.database.threadsConnected}</p>
            </div>
            <div className="bg-gray-800 p-4 rounded-lg shadow-md">
              <p className="text-lg text-gray-400"><strong>Total Connections:</strong> {performanceMetrics.database.totalConnections}</p>
            </div>
            <div className="bg-gray-800 p-4 rounded-lg shadow-md">
              <p className="text-lg text-gray-400"><strong>Uptime:</strong> {performanceMetrics.database.uptimeSeconds} seconds</p>
            </div>
            <div className="bg-gray-800 p-4 rounded-lg shadow-md">
              <p className="text-lg text-gray-400"><strong>Memory Usage:</strong> {((performanceMetrics.system.memoryUsage.used / performanceMetrics.system.memoryUsage.total) * 100).toFixed(2)}%</p>
            </div>
            <div className="bg-gray-800 p-4 rounded-lg shadow-md">
              <p className="text-lg text-gray-400"><strong>CPU Load:</strong> {performanceMetrics.system.cpuLoad}%</p>
            </div>
          </div>
          
          {/* Add the chart below the SGBD data */}
          {performanceMetrics && <SgbdMetricsChart data={performanceMetrics} />}
        </div>
      ) : (
        <p className="text-center text-white">Failed to load data</p>
      )}
    </div>
  );
};

export default SgbdOverview;
